import React, { useState } from "react";
import SignUp from "./SignUp";
import SignIn from "./SignIn";

export default function Forms({setIsForm}) {
    const [isSignUpForm, setIsSignUpForm] = useState(false);
    return (
        <div className='user-container'>
            {isSignUpForm ? 
                <SignUp setIsForm={setIsForm} setIsSignUpForm={setIsSignUpForm} />
                : <SignIn setIsForm={setIsForm} setIsSignUpForm={setIsSignUpForm} />
            }           
        </div>
    )
}
